    data = sys.stdin.read().split()
    S1, S2 = data[0], data[1]
    T1, T2 = data[2], data[3]

    # Define the vertices of the pentagon
    vertices = {
        'A': (0, 0),
        'B': (1, 0),
        'C': (1/2, math.sqrt(3)/2),
        'D': (-1/2, math.sqrt(3)/2),
        'E': (-1, 0)
    }

    def distance(p1, p2):
        return math.sqrt((p1[0] - p2[0])**2 + (p1[1] - p2[1])**2)

    def point_on_segment(p, s1, s2):
        x, y = p
        x1, y1 = s1
        x2, y2 = s2
        dx = x2 - x1
        dy = y2 - y1
        t = ((x - x1) * dx + (y - y1) * dy) / (dx * dx + dy * dy)
        if t < 0 or t > 1:
            return False
        px = x1 + t * dx
        py = y1 + t * dy
        return abs(distance(p, (px, py)) - distance(p, s1)) < 1e-9

    def check_segments_equal(S1, S2, T1, T2):
        for i in range(5):
            for j in range(i+1, 5):
                if point_on_segment(vertices[S1], vertices[i], vertices[j]):
                    if point_on_segment(vertices[T1], vertices[i], vertices[j]):
                        return True
        return False

    result = check_segments_equal(S1, S2, T1, T2)
    print("Yes" if result else "No")

